import React, { Component } from 'react';
import '../App.css';

export default class Blog extends Component {
    render() {
        const { news } = this.props;
        return(
            <div className="Blog">
                {news.blogImg}
                {this.props.blogTime}
                {this.props.blogTitle}
                {this.props.blogCate}
                {this.props.blogTitle}
                {this.props.blogContent}
                zxc
            </div>
        )
    }
}
